'use strict';
class LeverageProfilesUpdater {
    manager;
    static create(manager) {
        let instance;
        instance = new LeverageProfilesUpdater();
        instance.manager = manager;
        return instance;
    }
    updateLeverageProfiles(queueItem) {
        this.manager.processGetLeverageProfilesCommandQuery(queueItem);
    }
}
module.exports = LeverageProfilesUpdater
